/**
 * 1805. 字符串中不同整数的数目
 * https://leetcode.cn/problems/number-of-different-integers-in-a-string/
 */


/**
 * 56ms  83.61%
 * 41MB  85.25%
 */
var numDifferentIntegers = function (word) {

    word = word.replace(/[a-z]+/g, ' ').split(' ').filter(e => e.length != 0)
    // 不能直接 map(e=>+e),会超出范围表示为Infinity

    // 去掉前面的0
    for (let i = 0; i < word.length; i++) {

        let aheadHasZeroIdx = -1
        for (let j = 0; j < word[i].length; j++) {
            if (word[i][j] != 0) {
                break
            }

            aheadHasZeroIdx = j
        }
        if (aheadHasZeroIdx > -1) {
            word[i] = word[i].slice(aheadHasZeroIdx + 1)
        }
    }

    const set = new Set(word)
    return set.size

};

word = "a123bc34d8ef34"

word = ''

word = '01bb1'

ans = numDifferentIntegers(word)
console.log(ans)